def word_break(s: str, word_dict: List[str]) -> bool:
    word_set = set(word_dict)  # for quick look-up
    dp = [False] * (len(s) + 1)
    dp[0] = True  # base case

    for i in range(1, len(s) + 1):
        for j in range(i):
            if dp[j] is True and s[j:i] in word_set:
                # if dp[j] is True, which means the substring s[0, i) can be 
                # segmented, then check the substring s[j, i) whether in dictionary
                dp[i] = True
                break
    return dp[-1] # last element
